import React from "react"

class SearchForm extends React.Component {
  state = { search: "" }

  changeHandler = e => {
    this.setState({ [e.target.name]: e.target.value })
  }

  render() {
    return (
      <div>
        search form
        <form>
          <input
            type="text"
            name="search"
            placeholder="search"
            value={this.state.search}
            onChange={this.changeHandler}
          />
        </form>
      </div>
    )
  }
}

export default SearchForm
